import React from 'react';
import './App.scss';
import Home from './pages/Home';
import NavBar from './components/NavBar';
import {
    BrowserRouter as Router,
    Switch,
    Route,
  } from "react-router-dom";
import Calendar from './pages/Calendar';
import Event from './pages/Event';

function App() {
    return (
        <Router>
            <div className="App">
                <NavBar></NavBar>
                <Switch>
                    <Route path="/calendar">
                        <Calendar />
                    </Route>
                    <Route path="/events">
                        <Event />
                    </Route>
                    <Route path="/">
                        <Home />
                    </Route>
                </Switch>
            </div>
        </Router>
    );
}

export default App;
